import React from "react";
import Headers from "../components/layout/Headers";
import Footers from "../components/layout/Footers";
import BookingSeat from "../components/bookmovie/Bookseatpage/BookingSeat";

const Seat = () => {
  return (
    <>
      <Headers />
      <BookingSeat />
      <Footers />
    </>
  );
};

export default Seat;
